import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './VehicleProfile.css';

const VehicleProfile = () => {
  const [startPoint, setStartPoint] = useState('');
  const [destination, setDestination] = useState('');
  const [mapUrl, setMapUrl] = useState('');

  const handleSaveRoute = () => {
    if (startPoint && destination) {
      // Create the Google Maps URL with the directions from startPoint to destination
      const url = `https://www.google.com/maps/embed/v1/directions?key=YOUR_GOOGLE_MAPS_API_KEY&origin=${encodeURIComponent(startPoint)}&destination=${encodeURIComponent(destination)}&mode=driving`;
      setMapUrl(url);
    } else {
      alert("Please enter both starting point and destination.");
    }
  };

  return (
    <div className="vehicle-profile-container">
      <div className="main-content">
        <div className="header-container">
          <h1 className="page-title">Transportation</h1>
          <Link  to="/">{ }
          <button className="back-btn">‚Üê Back</button>
          </Link>
        </div>

        <div className="vehicle-profile-header">
          <h2>Vehicle Profile</h2>
        </div>

        <div className="profile-section">
          <div className="vehicle-info">
            <div className="vehicle-card">
              <h3>Bus No 1</h3>
              <img
                className="vehicle-img"
                src="https://jcbl.com/jcbl-images/products/school-bus/school%20banner.jpg"
                alt="Bus"
              />
              <p><strong>Model:</strong> JCBL Happy Bus</p>
              <p><strong>Current Driver:</strong> Alfonso Bator</p>
              <p><strong>Vehicle Status:</strong> In Use</p>
              <p><strong>Last Maintenance:</strong> Aug 30, 2024</p>
            </div>
          </div>
          <div className="vehicle-statistics">
            <h3>Statistics</h3>
            <div className="stats">
              <div className="stat-item">
                <h4>22.7 Kms</h4>
                <p>Average</p>
              </div>
              <div className="stat-item">
                <h4>92581 km</h4>
                <p>Distance Travelled</p>
              </div>
              <div className="stat-item">
                <h4>6.5L</h4>
                <p>Average</p>
              </div>
              <div className="stat-item">
                <h4>17.5L</h4>
                <p>Fuel Left</p>
              </div>
            </div>
          </div>

          <div className="route-planning">
            <h3>Route Planning</h3>
            {mapUrl ? (
              <iframe
                title="Google Maps Directions"
                src={mapUrl}
                width="100%"
                height="400"
                style={{ border: "0" }}
                allowFullScreen=""
                loading="lazy"
              />
            ) : (
              <p>No route selected</p>
            )}
            <div className="route-inputs">
              <input
                type="text"
                placeholder="Enter starting point"
                value={startPoint}
                onChange={(e) => setStartPoint(e.target.value)}
              />
              <input
                type="text"
                placeholder="Enter destination"
                value={destination}
                onChange={(e) => setDestination(e.target.value)}
              />
              <button className="save-route-btn" onClick={handleSaveRoute}>
                Set Route
              </button>
            </div>
          </div>

          
        </div>
      </div>
    </div>
  );
};

export default VehicleProfile;
